func TestMACD(t *testing.T) {
	macd := ta.NewMACD(12, 26, 9)
	difs, dems := make([]float64, len(vals)), make([]float64, len(vals))
	for i := range vals {
		difs[i], dems[i] = macd.App(vals[i])
	}
	if err := compare(difs, macdDIFs, 256, 1e-5); err != nil {
		t.Fatal(err)
	}
	if err := compare(dems, macdDEMs, 256, 1e-5); err != nil {
		t.Fatal(err)
	}
}

func compare(vals0, vals1 []float64, offset int, prec float64) error {
	for i := range vals0 {
		if i < offset {
			continue
		}
		if math.Abs(vals0[i]-vals1[i]) > prec {
			return fmt.Errorf("Values not match: index=%d, %.10f != %.10f", i, vals0[i], vals1[i])
		}
	}
	return nil
}
